import React, { Component } from 'react'

 class Todoapplist extends Component {
  render() {
    return (
      <div>
        <ul class="ul">
          {this.props.items.map((item,index)=> (
            <li key ={index} onClick={this.props.deleteTask.bind(this,index)} >{item}</li>
          )

          )}
        </ul>
      </div>
    )
  }
}

export default Todoapplist


